sympy.sympy.core.mul.as_coeff_Mul:
def as_coeff_Mul(self, rational=False) -> tuple['Number', Expr]:
    """
    Efficiently extract the coefficient of a product.
    """
    coeff, args = self.args[0], self.args[1:]

    if coeff.is_Number:
        if not rational or coeff.is_Rational:
            if len(args) == 1:
                return coeff, args[0] # type: ignore
            else:
                return coeff, self._new_rawargs(*args) # type: ignore
        elif coeff.is_extended_negative:
            return S.NegativeOne, self._new_rawargs(*((-coeff,) + args))
    return S.One, self

sympy.sympy.core.numbers.__pow__:
def __pow__(self, other, mod=None):
    if mod is not None:
        try:
            other_int = as_int(other)
            mod_int = as_int(mod)
        except ValueError:
            pass
        else:
            return Integer(pow(self.p, other_int, mod_int))

    return super().__pow__(other, mod)

sympy.sympy.core.numbers.as_coeff_Mul:
def as_coeff_Mul(self, rational=False):
    """Efficiently extract the coefficient of a product."""
    if not rational:
        return self, S.One
    return S.One, self

